import { createIcon } from "../icon/createIcon";

export const DoubleChevronDownIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="DoubleChevronDownIcon">
    <path d="M11.504 6.603 6.002 11.5.5 6.603 1.503 5.5l4.498 4.004L10.499 5.5l1.003 1.103zm-.001-5.058L6.003 7l-5.5-5.455L1.558.5l4.445 4.408L10.448.5l1.055 1.045z" />
  </svg>,
  "DoubleChevronDown",
  "double chevron down"
);
